// SavingsCalculator.js

import React, { useState } from 'react';
import '../App.css'; // Import custom styles for the SavingsCalculator

const SavingsCalculator = () => {
  const [formData, setFormData] = useState({
    needSolarFor: '',
    monthlyBill: ''
  });

  const [results, setResults] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Mock calculation logic based on the input data
    const calculatedResults = {
      systemSize: '3 kW',
      spaceRequired: '238 sqft',
      annualEnergyGenerated: '4,286 Units',
      annualSavings: '₹ 30,000',
      price: '₹ 1,92,598',
      subsidy: '₹ 78,000'
    };
    setResults(calculatedResults);
  };

  return (
    <div className="savings-calculator-container">
      <h2>Calculate Your Savings</h2>
      <p>Explore the Potential of Solar Energy and Start Saving From Day 1!</p>
      <form className="savings-calculator-form" onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="needSolarFor">Do You Need Solar For</label>
          <input
            type="text"
            id="needSolarFor"
            name="needSolarFor"
            value={formData.needSolarFor}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="monthlyBill">Enter Your Monthly Electricity Bill (in ₹)</label>
          <input
            type="number"
            id="monthlyBill"
            name="monthlyBill"
            value={formData.monthlyBill}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit" className="calculate-button">Calculate</button>
      </form>
      {results && (
        <div className="results">
          <div className="result-item">
            <span>System Size</span>
            <strong>{results.systemSize}</strong>
          </div>
          <div className="result-item">
            <span>Space Required</span>
            <strong>{results.spaceRequired}</strong>
          </div>
          <div className="result-item">
            <span>Annual Energy Generated</span>
            <strong>{results.annualEnergyGenerated}</strong>
          </div>
          <div className="result-item">
            <span>Annual Savings</span>
            <strong>{results.annualSavings}</strong>
          </div>
          <div className="result-item">
            <span>Price (Excluding Subsidy)</span>
            <strong>{results.price}</strong>
          </div>
          <div className="result-item">
            <span>Subsidy</span>
            <strong>{results.subsidy}</strong>
          </div>
          <div className="actions">
            <button className="start-journey-button">Start Your Solar Journey</button>
            <button className="finance-button">Interested in Finance?</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default SavingsCalculator;
